package com.mobile.app.moonplay;public class episodes {    private String episode;    private String video;    private String description;    public episodes(){    }    public episodes(String episode, String video, String description) {        this.episode = episode;        this.video = video;        this.description = description;    }    public String getEpisode() {        return episode;    }    public void setEpisode(String episode) {        this.episode = episode;    }    public String getVideo() {        return video;    }    public void setVideo(String video) {        this.video = video;    }    public String getDescription() {        return description;    }    public void setDescription(String description) {        this.description = description;    }}